import styled from 'styled-components'

export const PropertyHeaderWrapper = styled.header`
  display: flex;
  justify-content: space-between;
  border: 1px solid red;
`;

export const PropertyImageWrapper = styled.div`
border-radius: 20px;
margin: 10px 0;
img {
height: 100%;
width: 100%;
border-radius: inherit;
}

`;

export const PropertyInforWrapper = styled.section`
 h3 {
 font-size: 1.19em;
 }
 .info-secudary {
   display: flex;
   align-items: center;
   justify-content: space-between;
   }
   
   
 }
.info-secudary-type {
   display: flex;
   align-items: center;
  .info-type-margin {
   margin: 0 10px 0 5px; 
  }
} 
  
 
`;
